import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Header from '../components/Header';

const HomeContainer = styled.div`
  width: 100%;
`;

const HeroSection = styled.section`
  height: 100vh;
  padding-top: 80px;
  position: relative;
`;

const CarouselSlide = styled.div`
  height: calc(100vh - 80px);
  background: ${props => props.bgGradient || 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)'};
  background-size: cover;
  background-position: center;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  position: relative;
`;

const HeroContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  z-index: 2;
`;

const MainHeading = styled.h1`
  font-size: 4rem;
  color: #ffffff;
  margin-bottom: 20px;
  font-weight: 700;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.5);
  
  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const SubHeading = styled.p`
  font-size: 1.5rem;
  color: #ffffff;
  margin-bottom: 40px;
  opacity: 0.9;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5);
  
  @media (max-width: 768px) {
    font-size: 1.2rem;
  }
`;

const CTAButton = styled.button`
  padding: 15px 40px;
  font-size: 1.2rem;
  background-color: #f2381a;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: all 0.3s ease;
  text-transform: uppercase;
  font-weight: 600;

  &:hover {
    background-color: #d42d15;
    transform: translateY(-2px);
  }
`;

const CustomCarousel = styled(Carousel)`
  .carousel .slide {
    background: transparent;
  }
  
  .carousel .control-dots {
    bottom: 30px;
    z-index: 10;
  }
  
  .carousel .control-dots .dot {
    background: rgba(255, 255, 255, 0.5);
    width: 12px;
    height: 12px;
    margin: 0 8px;
    border-radius: 50%;
  }
  
  .carousel .control-dots .dot.selected {
    background: #f2381a;
  }
  
  .carousel .control-arrow {
    background: rgba(0, 0, 0, 0.3);
    border-radius: 50%;
    width: 50px;
    height: 50px;
    top: 50%;
    transform: translateY(-50%);
    z-index: 10;
  }
  
  .carousel .control-arrow:hover {
    background: rgba(0, 0, 0, 0.5);
  }
  
  .carousel .control-arrow.control-prev {
    left: 20px;
  }
  
  .carousel .control-arrow.control-next {
    right: 20px;
  }
`;

// Event Timer Section Styles
const EventTimerSection = styled.section`
  background: linear-gradient(135deg, #1e3c72 0%, #2a5298 100%);
  padding: 80px 0;
  text-align: center;
  position: relative;
  overflow: hidden;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: url('data:image/svg+xml,<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100"><defs><pattern id="grain" width="100" height="100" patternUnits="userSpaceOnUse"><circle cx="50" cy="50" r="1" fill="%23ffffff" opacity="0.1"/></pattern></defs><rect width="100" height="100" fill="url(%23grain)"/></svg>') repeat;
    opacity: 0.3;
  }
`;

const TimerContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  position: relative;
  z-index: 2;
`;

const EventTitle = styled.h2`
  font-size: 3rem;
  color: #ffffff;
  margin-bottom: 10px;
  font-weight: 700;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.3);
  
  @media (max-width: 768px) {
    font-size: 2rem;
  }
`;

const EventSubtitle = styled.p`
  font-size: 1.3rem;
  color: #ffffff;
  margin-bottom: 50px;
  opacity: 0.9;
  
  @media (max-width: 768px) {
    font-size: 1.1rem;
    margin-bottom: 30px;
  }
`;

const CountdownContainer = styled.div`
  display: flex;
  justify-content: center;
  gap: 30px;
  margin-bottom: 40px;
  
  @media (max-width: 768px) {
    gap: 15px;
    flex-wrap: wrap;
  }
`;

const CountdownBox = styled.div`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(10px);
  border: 1px solid rgba(255, 255, 255, 0.2);
  border-radius: 15px;
  padding: 25px 20px;
  min-width: 120px;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.1);
  transition: transform 0.3s ease;
  
  &:hover {
    transform: translateY(-5px);
  }
  
  @media (max-width: 768px) {
    min-width: 80px;
    padding: 20px 15px;
  }
`;

const CountdownNumber = styled.div`
  font-size: 3rem;
  font-weight: 700;
  color: #ffffff;
  line-height: 1;
  margin-bottom: 8px;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.3);
  
  @media (max-width: 768px) {
    font-size: 2rem;
  }
`;

const CountdownLabel = styled.div`
  font-size: 0.9rem;
  color: #ffffff;
  text-transform: uppercase;
  letter-spacing: 1px;
  opacity: 0.8;
  font-weight: 500;
  
  @media (max-width: 768px) {
    font-size: 0.8rem;
  }
`;

const EventButton = styled.button`
  padding: 18px 45px;
  font-size: 1.1rem;
  background-color: #f2381a;
  color: white;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  transition: all 0.3s ease;
  text-transform: uppercase;
  font-weight: 600;
  letter-spacing: 1px;
  box-shadow: 0 4px 15px rgba(242, 56, 26, 0.3);
  
  &:hover {
    background-color: #d42d15;
    transform: translateY(-2px);
    box-shadow: 0 6px 20px rgba(242, 56, 26, 0.4);
  }
  
  @media (max-width: 768px) {
    padding: 15px 35px;
    font-size: 1rem;
  }
`;

const Home = () => {
  const heroSlides = [
    {
      title: "Neutek Nursing Services",
      subtitle: "Professional Healthcare Solutions for Your Needs",
      buttonText: "Get Started",
      bgGradient: "linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)), linear-gradient(135deg, #667eea 0%, #764ba2 100%)"
    },
    {
      title: "Expert Nursing Care",
      subtitle: "Compassionate healthcare delivered by certified professionals with years of experience",
      buttonText: "Learn More",
      bgGradient: "linear-gradient(rgba(0, 0, 0, 0.6), rgba(0, 0, 0, 0.6)), linear-gradient(135deg, #f093fb 0%, #f5576c 100%)"
    },
    {
      title: "24/7 Patient Support",
      subtitle: "Round-the-clock nursing care and support services for your peace of mind",
      buttonText: "Contact Us",
      bgGradient: "linear-gradient(rgba(0, 0, 0, 0.6), rgba(0, 0, 0, 0.6)), linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)"
    },
    {
      title: "Home Healthcare Solutions",
      subtitle: "Bringing professional medical care to the comfort of your own home",
      buttonText: "Our Services",
      bgGradient: "linear-gradient(rgba(0, 0, 0, 0.6), rgba(0, 0, 0, 0.6)), linear-gradient(135deg, #43e97b 0%, #38f9d7 100%)"
    }
  ];

  // Event countdown logic
  const [timeLeft, setTimeLeft] = useState({
    days: 0,
    hours: 0,
    minutes: 0,
    seconds: 0
  });

  useEffect(() => {
    // Set your event date here (Year, Month-1, Day, Hour, Minute)
    const eventDate = new Date(2024, 11, 25, 10, 0, 0); // December 25, 2024, 10:00 AM
    
    const timer = setInterval(() => {
      const now = new Date().getTime();
      const distance = eventDate.getTime() - now;
      
      if (distance > 0) {
        setTimeLeft({
          days: Math.floor(distance / (1000 * 60 * 60 * 24)),
          hours: Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)),
          minutes: Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60)),
          seconds: Math.floor((distance % (1000 * 60)) / 1000)
        });
      } else {
        setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });
      }
    }, 1000);

    return () => clearInterval(timer);
  }, []);

  return (
    <>
      <Header />
      <HomeContainer>
        <HeroSection>
          <CustomCarousel
            autoPlay
            infiniteLoop
            interval={5000}
            showThumbs={false}
            showStatus={false}
            swipeable
            emulateTouch
            stopOnHover
          >
            {heroSlides.map((slide, index) => (
              <div key={index}>
                <CarouselSlide bgGradient={slide.bgGradient}>
                  <HeroContent>
                    <MainHeading>{slide.title}</MainHeading>
                    <SubHeading>{slide.subtitle}</SubHeading>
                    <CTAButton>{slide.buttonText}</CTAButton>
                  </HeroContent>
                </CarouselSlide>
              </div>
            ))}
          </CustomCarousel>
        </HeroSection>
        
        {/* Event Timer Section */}
        <EventTimerSection>
          <TimerContainer>
            <EventTitle>Annual Healthcare Conference 2024</EventTitle>
            <EventSubtitle>Join us for the most comprehensive nursing and healthcare event of the year</EventSubtitle>
            
            <CountdownContainer>
              <CountdownBox>
                <CountdownNumber>{timeLeft.days}</CountdownNumber>
                <CountdownLabel>Days</CountdownLabel>
              </CountdownBox>
              <CountdownBox>
                <CountdownNumber>{timeLeft.hours}</CountdownNumber>
                <CountdownLabel>Hours</CountdownLabel>
              </CountdownBox>
              <CountdownBox>
                <CountdownNumber>{timeLeft.minutes}</CountdownNumber>
                <CountdownLabel>Minutes</CountdownLabel>
              </CountdownBox>
              <CountdownBox>
                <CountdownNumber>{timeLeft.seconds}</CountdownNumber>
                <CountdownLabel>Seconds</CountdownLabel>
              </CountdownBox>
            </CountdownContainer>
            
            <EventButton>Register Now</EventButton>
          </TimerContainer>
        </EventTimerSection>
      </HomeContainer>
    </>
  );
};

export default Home;
